        let logo = document.querySelector('.logo');
        hamburger.addEventListener('click', ()=>{
            console.log('clicked');
            navbar.classList.toggle('h-media');
            navlist.classList.toggle('v-media');
            search.classList.toggle('v-media');
            logo.classList.toggle('v-media');
        });
    return(
        
            <div className="header h-media">
                <div id="logo" className="v-media">
                    <Link to = "/"><img src={logo} alt="" id="logo-img"/></Link>
                </div>
                <nav className="navbar v-media">
                    <ul>
                        <li><Link to="/work" className="navbar-items">My work</Link></li>
                        <li><Link to="/contents" className="navbar-items">My contents</Link></li>
                        <li><Link to="/about" className="navbar-items">About me</Link></li>
                    </ul>
                </nav>
                <div id="hamburger">
            <ul>
                <li></li>
                <li></li>
                <li></li>
            </ul>
        </div>
            </div>
            
        
    )
}
